import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
      height: 100px;
      width:350px;
      background-color:aliceblue;
      display:flex;
      flex-direction:row;
`

const ColIcon = styled.div`
      height: 30%;
      width:350px;
      background-color:aliceblue;
`
const ColBody = styled.div`
`

const App =() => {
  return (
    <Container>
      <ColIcon>
        <p>Hola</p>
      </ColIcon>
      <ColBody>
        <p>zzzz xxxx</p>
      </ColBody>
    </Container>
  );
}

export default App;
